import React from 'react';
import Link from 'gatsby-link';
import ExternalLink from '../components/ExternalLink.js';

class IndexPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      __cnt__: 0,
      bastionLogo: `data:image/png;base64,`
    }
  }

  increment() {
    if (this.state.__cnt__ >= 11) {
      window.open('https://6b33726e333170346e6963.gitlab.io/217128516532043776');
      this.setState({
        __cnt__: 0
      });
    }
    else {
      this.setState({
        __cnt__: this.state.__cnt__+1
      });
    }
  }

  render() {
    return (
      <div className='IndexPage-container'>
        <img
          src={ this.state.bastionLogo }
          onClick={ () => this.increment() }
          width='1024'
          height='176'
        />
        <p>Give awesome perks to your Discord server!</p>
        <Link to='/add'>
          <button>Add Bastion to Discord</button>
        </Link>
        <ExternalLink to='https://discord.gg/fzx8fkt'>
          <button className='primary'>Join Bastion HQ</button>
        </ExternalLink>
      </div>
    );
  }
}

export default IndexPage;
